// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract Presale {

  address treasury;
  uint256 saleRemainder;
  uint256 buyMultiplier;
  uint256 buyDivider;
  bool public presaleHasStarted;

  struct ParticipantStruct {
    uint256 lockedAmount;
    uint256 unlockDate;
    bool claimed;
  }

  mapping(address => ParticipantStruct) participants;

  address usdcTokenAddress;
  IERC20 usdcToken;

  address usdtTokenAddress;
  IERC20 usdtToken;

  address utilityTokenAddress;
  IERC20 utilityToken;

  event Sold(address buyer, uint256 amount);

  modifier onlyTreasury {
    require(msg.sender == treasury, "Not treasury");
    _;
  }

  constructor(address _utilityTokenAddress) {
    utilityTokenAddress = _utilityTokenAddress;
    utilityToken = IERC20(utilityTokenAddress);
    saleRemainder = 125000 ether;
    treasury = msg.sender;
  }

  // (usdAmount * 6250) / 21 === 40p per token
  // multiplier = 6250
  // divider = 21
  function setRate(
    address _usdcTokenAddress, 
    address _usdtTokenAddress,
    uint256 _multiplier,
    uint256 _divider
  ) external onlyTreasury {
    usdcTokenAddress = _usdcTokenAddress;
    usdcToken = IERC20(usdcTokenAddress);

    usdtTokenAddress = _usdtTokenAddress;
    usdtToken = IERC20(usdtTokenAddress);

    buyMultiplier = _multiplier;
    buyDivider = _divider;
  }

  function getRate() external view returns (uint256, uint256) {
    return (buyMultiplier, buyDivider);
  }

  function togglePresaleHasStarted() external onlyTreasury {
    // make sure kdsk balance for this contract matches amount allocated in whitepaper
    // 12.5% of KDSK
    require(
      utilityToken.balanceOf(address(this)) == 125000 ether, 
      "Utility token balance does not match expected amount"
    );
    presaleHasStarted = !presaleHasStarted;
  }

  function getParticipant() external view returns (ParticipantStruct memory) {
    return participants[msg.sender];
  }

  function claim() external {
    ParticipantStruct storage participant = participants[msg.sender];
    require(block.timestamp > participant.unlockDate, "Unlocked date is not due");
    require(participant.claimed == false, "You have already claimed your purchase");
    participant.claimed = true;
    utilityToken.transfer(msg.sender, participant.lockedAmount);
  }

  function buy(address usdTokenAddress, uint256 usdAmount) external {
    require(presaleHasStarted == true, "Presale has not started");
    require(saleRemainder > 0, "Presale has ended");
    // (usdAmount * 6250) / 21 === 40p per token
    // 6250/21 === USD equivalent of 40 pesewas
    uint256 buyAmount = (usdAmount * buyMultiplier) / buyDivider;
    require(saleRemainder >= buyAmount, "Amount remaining is lesser than the amount you're buying");

    if (usdTokenAddress == usdcTokenAddress) {
      usdcToken.transferFrom(msg.sender, treasury, usdAmount);
    } else if (usdTokenAddress == usdtTokenAddress) {
      usdtToken.transferFrom(msg.sender, treasury, usdAmount);
    }

    participants[msg.sender] = ParticipantStruct(
      buyAmount, 
      // block.timestamp + 21 days, 
      block.timestamp + 1 days, 
      false
    );

    saleRemainder -= buyAmount;
    emit Sold(msg.sender, buyAmount);
  }

}
